長持ち高撥水、こすれても長持ち撥水のシリコーン・フッ素の混合タイプ、ドロ汚れも付きにくい<br>大容量（１缶で傘4.7本分）<br>イヤなニオイの発生原因となる菌も除菌<br>しみついたニオイを抑える消臭成分を配合<br>低温環境においても噴射できる<br><br>用途<br>スポーツウェア、アウトドア用品、衣類、 レインウェア、傘等の繊維製品の防水・除菌・消臭・防汚<br>雨濡れするベランダ・庭・屋上のファブリック等の防水・除菌・消臭・防汚<br><br>使用できるもの<br>繊維製品（綿・ウール・ナイロン・ポリエステル・アクリル）、白色以外のもの<br>貴金属や高価格品には使用しないでください。<br>※皮ふや飲食物が直接触れる部分には使用しないでください。<br>※生物を入れる容器には使用できません。<br><br>使用できないもの<br>皮革、スウェード、絹、毛皮、ビニール、ポリウレタン、ゴム、プラスチック、和服、ドライクリーニングできない衣類、白色の繊維製品、エナメル製品、靴 等<br>仕様<br>容量(ml):330<br>質量:385g<br>材質・仕上げ<br>主成分:フッ素、シリコーン、消臭・除菌成分<table width="800" border="0" cellspacing="0" cellpadding="0">

